import React from "react";
import "./Burger.css";

const Burger = ({ open, setOpen }) => {
  return (
    <div
      className={`burger-menu ${open ? "open" : ""}`}
      onClick={() => setOpen(!open)}
    ></div>
  );
};

export default Burger;
